import React from 'react';
import { Cpu, HardDrive, Database, Zap, AlertTriangle, CheckCircle } from 'lucide-react';

interface MetricCardProps {
  title: string;
  value: string;
  subtitle: string;
  icon: 'cpu' | 'memory' | 'disk';
  color: 'blue' | 'green' | 'purple' | 'red' | 'yellow';
  percentage: number;
}

const MetricCard: React.FC<MetricCardProps> = ({
  title,
  value,
  subtitle,
  icon,
  color,
  percentage
}) => {
  const getIcon = () => {
    switch (icon) {
      case 'cpu':
        return <Cpu className="h-7 w-7" />;
      case 'memory':
        return <Database className="h-7 w-7" />;
      case 'disk':
        return <HardDrive className="h-7 w-7" />;
      default:
        return <Cpu className="h-7 w-7" />;
    }
  };

  const getColorClasses = () => {
    switch (color) {
      case 'blue':
        return {
          icon: 'text-blue-600',
          progress: 'bg-gradient-to-r from-blue-500 to-cyan-500',
          bg: 'bg-gradient-to-br from-blue-50 to-cyan-50 dark:from-blue-900/20 dark:to-cyan-900/20',
          border: 'border-blue-200 dark:border-blue-800'
        };
      case 'green':
        return {
          icon: 'text-green-600',
          progress: 'bg-gradient-to-r from-green-500 to-emerald-500',
          bg: 'bg-gradient-to-br from-green-50 to-emerald-50 dark:from-green-900/20 dark:to-emerald-900/20',
          border: 'border-green-200 dark:border-green-800'
        };
      case 'purple':
        return {
          icon: 'text-purple-600',
          progress: 'bg-gradient-to-r from-purple-500 to-pink-500',
          bg: 'bg-gradient-to-br from-purple-50 to-pink-50 dark:from-purple-900/20 dark:to-pink-900/20',
          border: 'border-purple-200 dark:border-purple-800'
        };
      case 'red':
        return {
          icon: 'text-red-600',
          progress: 'bg-gradient-to-r from-red-500 to-pink-500',
          bg: 'bg-gradient-to-br from-red-50 to-pink-50 dark:from-red-900/20 dark:to-pink-900/20',
          border: 'border-red-200 dark:border-red-800'
        };
      case 'yellow':
        return {
          icon: 'text-yellow-600',
          progress: 'bg-gradient-to-r from-yellow-500 to-orange-500',
          bg: 'bg-gradient-to-br from-yellow-50 to-orange-50 dark:from-yellow-900/20 dark:to-orange-900/20',
          border: 'border-yellow-200 dark:border-yellow-800'
        };
      default:
        return {
          icon: 'text-blue-600',
          progress: 'bg-gradient-to-r from-blue-500 to-cyan-500',
          bg: 'bg-gradient-to-br from-blue-50 to-cyan-50 dark:from-blue-900/20 dark:to-cyan-900/20',
          border: 'border-blue-200 dark:border-blue-800'
        };
    }
  };

  const getStatusEmoji = () => {
    if (percentage > 90) return '😱'; // Critical
    if (percentage > 80) return '😰'; // High
    if (percentage > 60) return '😐'; // Medium
    if (percentage > 30) return '😊'; // Good
    return '😸'; // Excellent
  };

  const getStatusIcon = () => {
    if (percentage > 80) return <AlertTriangle className="h-4 w-4 text-red-500" />;
    if (percentage > 60) return <Zap className="h-4 w-4 text-yellow-500" />;
    return <CheckCircle className="h-4 w-4 text-green-500" />;
  };

  const colorClasses = getColorClasses();
  const isHighUsage = percentage > 80;
  const isMediumUsage = percentage > 60;

  return (
    <div className="metric-card bg-white/80 dark:bg-dark-800/80 backdrop-blur-sm border-0 shadow-xl hover:shadow-2xl transform hover:scale-105 transition-all duration-300">
      <div className="flex items-center justify-between mb-6">
        <div className={`p-3 rounded-xl ${colorClasses.bg} ${colorClasses.border} border shadow-lg`}>
          <div className={colorClasses.icon}>
            {getIcon()}
          </div>
        </div>
        <div className="text-right">
          <div className="text-3xl font-bold bg-gradient-to-r from-gray-900 to-gray-700 dark:from-white dark:to-gray-300 bg-clip-text text-transparent">
            {value}
          </div>
          <div className="flex items-center justify-end space-x-1 mt-1">
            {getStatusIcon()}
            <span className="text-lg">{getStatusEmoji()}</span>
          </div>
        </div>
      </div>

      <div className="space-y-3">
        <h3 className="font-bold text-lg text-gray-900 dark:text-white">
          {title}
        </h3>
        <p className="text-sm text-gray-600 dark:text-gray-400">
          {subtitle}
        </p>

        {/* Enhanced Progress Bar */}
        <div className="relative">
          <div className="w-full bg-gray-200 dark:bg-gray-700 rounded-full h-3 shadow-inner">
            <div
              className={`h-3 rounded-full transition-all duration-500 ${colorClasses.progress} ${
                isHighUsage ? 'animate-pulse shadow-lg' : ''
              }`}
              style={{ width: `${Math.min(percentage, 100)}%` }}
            />
          </div>
          {/* Progress glow effect */}
          {isHighUsage && (
            <div
              className={`absolute top-0 h-3 rounded-full blur-sm ${colorClasses.progress} opacity-50`}
              style={{ width: `${Math.min(percentage, 100)}%` }}
            />
          )}
        </div>

        {/* Usage Level Indicator */}
        <div className="flex items-center justify-between text-xs">
          <span className="text-gray-500 dark:text-gray-400 font-medium">0%</span>
          <span className={`font-bold ${
            isHighUsage ? 'text-red-600 dark:text-red-400' : 
            isMediumUsage ? 'text-yellow-600 dark:text-yellow-400' : 
            'text-green-600 dark:text-green-400'
          }`}>
            {percentage.toFixed(1)}%
          </span>
          <span className="text-gray-500 dark:text-gray-400 font-medium">100%</span>
        </div>

        {/* Status message */}
        <div className="text-xs text-center py-2 px-3 rounded-lg bg-gray-100 dark:bg-gray-800">
          {percentage > 90 && '😱 Critical usage - immediate attention needed!'}
          {percentage > 80 && percentage <= 90 && '😰 High usage - monitor closely'}
          {percentage > 60 && percentage <= 80 && '😐 Moderate usage - keep an eye on it'}
          {percentage > 30 && percentage <= 60 && '😊 Good performance - purring along'}
          {percentage <= 30 && '😸 Excellent - everything is purr-fect!'}
        </div>
      </div>
    </div>
  );
};

export default MetricCard;
